import { useState } from "react";

// The CalendarProps interface has been removed.
// Type annotations have been removed from the function signature and state hooks.

export default function Calendar({ journalEntries, setJournalEntries }) {
  const [currentDate, setCurrentDate] = useState(new Date());
  const [selectedDate, setSelectedDate] = useState(null);

  const getDaysInMonth = (date) => {
    const year = date.getFullYear();
    const month = date.getMonth();
    const firstDay = new Date(year, month, 1);
    const lastDay = new Date(year, month + 1, 0);
    const daysInMonth = lastDay.getDate();
    const startingDayOfWeek = firstDay.getDay();

    const days = [];

    // Add empty cells for days before the first day of the month
    for (let i = 0; i < startingDayOfWeek; i++) {
      days.push(null);
    }

    // Add days of the month
    for (let day = 1; day <= daysInMonth; day++) {
      days.push(day);
    }

    return days;
  };

  const formatDate = (day) => {
    const year = currentDate.getFullYear();
    const month = currentDate.getMonth();
    return `${year}-${String(month + 1).padStart(2, "0")}-${String(day).padStart(2, "0")}`;
  };

  const toggleJournalEntry = (dateString) => {
    setJournalEntries({
      ...journalEntries,
      [dateString]: !journalEntries[dateString],
    });
  };

  const days = getDaysInMonth(currentDate);
  const monthNames = [
    "January",
    "February",
    "March",
    "April",
    "May",
    "June",
    "July",
    "August",
    "September",
    "October",
    "November",
    "December",
  ];

  return (
    <div className="bg-white/80 backdrop-blur-sm rounded-3xl p-6 shadow-lg border border-green-200">
      <div className="flex items-center justify-between mb-6">
        <div className="flex items-center gap-2">
          <span className="text-2xl">üìÖ</span>
          <h3 className="text-xl font-bold text-green-600">Journal Calendar</h3>
        </div>
        <div className="flex items-center gap-2">
          <button
            onClick={() => setCurrentDate(new Date(currentDate.getFullYear(), currentDate.getMonth() - 1))}
            className="p-2 rounded-full bg-pink-100 hover:bg-pink-200 transition-colors"
          >
            ‚Üê
          </button>
          <span className="font-semibold text-gray-700 min-w-[120px] text-center">
            {monthNames[currentDate.getMonth()]} {currentDate.getFullYear()}
          </span>
          <button
            onClick={() => setCurrentDate(new Date(currentDate.getFullYear(), currentDate.getMonth() + 1))}
            className="p-2 rounded-full bg-pink-100 hover:bg-pink-200 transition-colors"
          >
            ‚Üí
          </button>
        </div>
      </div>

      {/* Days of week */}
      <div className="grid grid-cols-7 gap-1 mb-2">
        {["Sun", "Mon", "Tue", "Wed", "Thu", "Fri", "Sat"].map((day) => (
          <div key={day} className="text-center text-sm font-medium text-gray-500 p-2">
            {day}
          </div>
        ))}
      </div>

      {/* Calendar grid */}
      <div className="grid grid-cols-7 gap-1">
        {days.map((day, index) => {
          if (day === null) {
            return <div key={index} className="p-2"></div>;
          }

          const dateString = formatDate(day);
          const hasJournal = journalEntries[dateString];
          const isToday =
            new Date().toDateString() ===
            new Date(currentDate.getFullYear(), currentDate.getMonth(), day).toDateString();

          return (
            <button
              key={day}
              onClick={() => toggleJournalEntry(dateString)}
              className={`
                relative p-2 rounded-lg text-sm font-medium transition-all duration-200 hover:scale-110
                ${isToday ? "ring-2 ring-pink-400" : ""}
                ${hasJournal ? "bg-pink-100 text-pink-700" : "bg-gray-50 text-gray-600 hover:bg-gray-100"}
              `}
            >
              <span className="block">{day}</span>
              <div className="absolute -top-1 -right-1 text-lg">{hasJournal ? "üíñ" : "üò¢"}</div>
            </button>
          );
        })}
      </div>

      <div className="mt-4 text-xs text-center text-gray-500">
        Click on dates to toggle journal entries! üíñ = journaled, üò¢ = missed
      </div>
    </div>
  );
}
